const initialState={

id:{
    CategoryName: '',
    img: '',
    name: '',
    type: '',
    price: 0
  }
}


 const PriceReducer=(State=initialState,action)=>{
    console.log(action.amount+10);
    switch (action.type) {
        case 'ADDTOCART':
            return {...State,
                [action.id]:{
                    CategoryName:action.CategoryName,
                    img:action.img,
                    name:action.name,
                    type: action.type,
                    price:action.price
                         }}
        
        
        default:return State
         
    }
}
export default PriceReducer
